// ==UserScript==
// @name         YT Favicon Changer
// @namespace    http://youtube.com
// @version      0.1
// @description  Changes Youtube Favicon to 2016/2017.
// @author       Objectful#1215
// @match *://*.youtube.com/*
// @match *://*.youtu.be/*
// @grant        none
// ==/UserScript==

(function() {
    'use strict';
    window.addEventListener('load', function() {
        var icon = document.querySelector('link[rel~="icon"]');
        var copy = icon.cloneNode(!0);
        copy.href = "data:image/x-icon;base64,";
        icon.parentNode.removeChild(icon);
        document.head.appendChild(copy);
    }, false);
})();
